    private String name;
    private String url;

    PokemonUltraRemixLeague(String name, String url) {
        this.name = name;
        this.url = url;
    }

    @Override
    public String getDisplayName() {
        return this.name;
    }

    @Override
    public String getSimpleName() {
        return this.name();
    }

    @Override
    public String getUrl(int numberOfShields) {
        return url.replace("{shields}", String.format("%d%d", numberOfShields, numberOfShields));
    }
